AC DC LIVE AT DONNINGTON
Format: Matroska

Live at Donington is the  recording of the AC/DC show at Donington Park on 17 August 1991, and it was the band's third &quot;Monsters of Rock&quot; festival. The two hour show was performed before 72,500 spectators and included real cannons, the Hells Bell, an inflatable Rosie and an inflatable Angus.
 It was filmed in 35 mm Panavision and had 26 cameras that included one situated inside a helicopter.

